import React from "react"

const CatIndex = ({ cats }) => {
   return (
      <main>
         {cats.map((cat, index) => {
         return (
            <>
               <p>{cat.name}</p>
               <p>{cat.age}</p>
            </>
         )
         })}
      </main>
   )
}

export default CatIndex
